import React from "react";
import Card from "../ui/Card";
import styles from "./users.module.css";

const UsersList = (props) => {
  return(
  <Card>
     <ul>
      {props.data.map((user) => ( 
      <li key={user.age}>
          {user.UserName} ({user.age} years old)
      </li>
      ))}
      </ul>
    </Card>
)};

export default UsersList;
